 // CREATE, READ, UPDATE, DELETE, LOGIN, LOGOUT\n  entity    String // Название сущности (User, Org, Contact)\n  entityId  String? // ID сущности (опциональное для общих операций)\n  details   String? // JSON с деталями изменений\n  timestamp DateTime @default(now())\n\n  // Связи\n  user User? @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@map(\"audit_logs\")\n}\n\nmodel Consent {\n  id        String   @id @default(cuid())\n  userId    String\n  type      String // PERSONAL_DATA, MARKETING, ANALYTICS, COOKIES\n  grantedAt DateTime @default(now())\n  basis     String // Основание для обработки (согласие, договор, etc.)\n  details   String? // Дополнительная информация\n\n  // Связи\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, type])\n  @@map(\"consents\")\n}\n\nmodel Course {\n  id          String   @id @default(cuid())\n  title       String\n  description String?\n  price       Float?\n  duration    Int? // Длительность в часах\n  level       String   @default(\"BEGINNER\") // BEGINNER, INTERMEDIATE, ADVANCED\n  isPublished Boolean  @default(false)\n  authorId    String\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Связи\n  author         User             @relation(fields: [authorId], references: [id], onDelete: Cascade)\n  blocks         Block[]\n  favoritedBy    FavoriteCourse[]\n  startedBy      StartedCourse[]\n  lessonProgress LessonProgress[]\n  courseProgress CourseProgress[]\n\n  @@map(\"courses\")\n}\n\nmodel Block {\n  id        String   @id @default(cuid())\n  title     String\n  content   String?\n  type      String   @default(\"TEXT\") // TEXT, VIDEO, QUIZ, ASSIGNMENT\n  position  Int // Позиция блока в курсе\n  courseId  String\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Связи\n  course   Course           @relation(fields: [courseId], references: [id], onDelete: Cascade)\n  progress LessonProgress[]\n\n  @@map(\"blocks\")\n}\n\nmodel FavoriteCourse {\n  id        String   @id @default(cuid())\n  userId    String\n  courseId  String\n  createdAt DateTime @default(now())\n\n  // Связи\n  user   User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n  course Course @relation(fields: [courseId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, courseId])\n  @@map(\"favorite_courses\")\n}\n\nmodel StartedCourse {\n  id        String   @id @default(cuid())\n  userId    String\n  courseId  String\n  startedAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Связи\n  user   User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n  course Course @relation(fields: [courseId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, courseId])\n  @@map(\"started_courses\")\n}\n\nmodel LessonProgress {\n  id          String    @id @default(cuid())\n  userId      String\n  lessonId    String // ID блока с типом LESSON\n  courseId    String\n  isCompleted Boolean   @default(false)\n  completedAt DateTime?\n  createdAt   DateTime  @default(now())\n  updatedAt   DateTime  @updatedAt\n\n  // Связи\n  user   User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n  lesson Block  @relation(fields: [lessonId], references: [id], onDelete: Cascade)\n  course Course @relation(fields: [courseId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, lessonId])\n  @@map(\"lesson_progress\")\n}\n\nmodel CourseProgress {\n  id               String    @id @default(cuid())\n  userId           String\n  courseId         String\n  completedLessons Int       @default(0)\n  totalLessons     Int       @default(0)\n  progressPercent  Float     @default(0)\n  isCompleted      Boolean   @default(false)\n  completedAt      DateTime?\n  createdAt        DateTime  @default(now())\n  updatedAt        DateTime  @updatedAt\n\n  // Связи\n  user   User   @relation(fields: [userId], references: [id], onDelete: Cascade)